predictions = model.predict(source="/content/drive/MyDrive/Beyblade_Dataset/Video_Di_Verifica/verifica1.MOV", save=True, save_txt=True)

"""### Risultati inferenza: screenshot immagini"""

import matplotlib.pyplot as plt
import random
import os
import cv2
from IPython.display import Image


# Liste per salvare i frame classificati come "spin" e "still"
spin_frames = []
still_frames = []

# Iterazione sui risultati del modello
for result in predictions:  # Itera sui risultati
    # Ottieni il frame originale
    frame = result.orig_img

    # Ottieni le predizioni
    for box in result.boxes:
        cls_id = int(box.cls)  # Ottieni l'ID della classe predetta (numero intero)
        label = model.names[cls_id]  # Ottieni il nome della classe dall'ID usando `model.names`

        if label == "spin":
            spin_frames.append(frame)
        elif label == "still":
            still_frames.append(frame)

# Per la classe "spin": primo, casuale, casuale
if len(spin_frames) >= 3:
    selected_spin_frames = [spin_frames[0]]  # Primo frame
    # Seleziona due frame casuali dalla lista, escludendo il primo e l'ultimo
    if len(spin_frames) > 2:
        selected_spin_frames += random.sample(spin_frames[1:-1], 2)  # Prende due frame casuali nel mezzo
else:
    selected_spin_frames = spin_frames

# Per la classe "still": due casuali e l'ultimo
if len(still_frames) >= 3:
    selected_still_frames = random.sample(still_frames, 2)  # Prende due frame casuali
    selected_still_frames.append(still_frames[-1])  # Ultimo frame
else:
    selected_still_frames = still_frames

# Plot dei frame selezionati
fig, axes = plt.subplots(2, 3, figsize=(15, 6))

# Visualizza i frame "spin"
for i, frame in enumerate(selected_spin_frames):
    axes[0, i].imshow(cv2.cvtColor(frame, cv2.COLOR_BGR2RGB))
    axes[0, i].axis("off")
    axes[0, i].set_title("Spin")

# Visualizza i frame "still"
for i, frame in enumerate(selected_still_frames):
    axes[1, i].imshow(cv2.cvtColor(frame, cv2.COLOR_BGR2RGB))
    axes[1, i].axis("off")
    axes[1, i].set_title("Still")

plt.tight_layout()

